import React, {Component} from 'react'
import BasePage from '../BasePages/BasePage.js';
import Search from '../../components/ProfileBlocks/Search/Search.js'
import ProfileBlocksSecretary from '../../components/ProfileBlocks/Secretary/ProfileBlocksSecretary/ProfileBlocksSecretary.jsx'
import axios from 'axios'

class ProfileSecretary extends Component {
  /*
  static defaultProps = {
    themes_list: [],
    details:[], // Provide an empty array as default value
  };
*/

  state = {
    secretaryData: [],
  };

  componentDidMount() {
    console.log('пытаемся получить')
    const token = localStorage.getItem('token');
    if (token) {
      axios.get('http://127.0.0.1:8000/v1/main/secretary/profile/', {
        headers: {
          Authorization: `Token ${token}` // Устанавливаем заголовок авторизации с токеном
        }
      })
      .then(res => {
        console.log('Данные успешно получены:', res.data); // Вывод полученных данных в консоль
        this.setState({
          secretaryData: res.data,
        });
        console.log('сука здесь должен быть секретарь')
        console.log(this.state.secretaryData);

      })
      .catch(err => {
        console.error('Ошибка при получении данных:', err); // Вывод ошибки в консоль
      });
    }
  }
  
 
/*
  componentDidMount(){
    console.log('yfxfkb')
    let data;
    axios.get('http://127.0.0.1:8000/v1/main/secretary/profile/')
    .then(res => {
      data=res.data;
      this.setState({
        details: data
      });
      console.log(data)
    })
    .catch(err=> {
      console.log(err)
      console.log('ошибка сука')
    }
    )
  }*/

  render() {
    const { secretaryData } = this.state;
    return (
    <BasePage isAuthenticated={true} data={secretaryData}>
        <Search />
        <ProfileBlocksSecretary secretaryData={secretaryData}/>
      </BasePage>
    
    );
  }
}

export default ProfileSecretary;
